import React from "react";
import { StyleSheet, TouchableHighlight, Pressable, Text } from "react-native";

export default function CustomButton({ text, handlePress }) {
  return (
    <TouchableHighlight style={styles.container} onPress={handlePress}>
      <Text>{text}</Text>
    </TouchableHighlight>
  );
}

const styles = StyleSheet.create({
  container: {
    width: "100%",
    borderRadius: 5,
  },
});
